import {signUp} from './DatabaseController';

export const SignUp = (email, password, name, phoneNo, description, profileImg) => {

  try{
    signUp(email, password, name, phoneNo, description, profileImg);
  }
  catch{
    console.log("error occured");
    throw {type:400};
  }

}
